import { BaseLayout, Slider, Banner, FirstSection } from "components";

const Home = () => {
  return (
    <React.Fragment>
      <BaseLayout title="Sprawa Dla Imigranta">
        <Slider />
        <Banner />
        <FirstSection />
      </BaseLayout>
    </React.Fragment>
  );
};

export default Home;
